import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import HomePage from './components/HomePage';
import LoginPage from './components/LoginPage';
import UserProfile from './components/UserProfile';
import SwapRequests from './components/SwapRequests';
import ProfileDetails from './components/ProfileDetails';
import RequestSwap from './components/RequestSwap';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          {/* Main Routes */}
          <Route path="/" element={<HomePage />} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/profile" element={<UserProfile />} />
          <Route path="/swaps" element={<SwapRequests />} />
          
          {/* User Profile and Request Routes */}
          <Route path="/user/:id" element={<ProfileDetails />} />
          <Route path="/request/:userId" element={<RequestSwap />} />
          
          {/* Fallback route */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
